import React from "react";
import { Link, Route} from "react-router-dom";
import "./PortfolioNav.css";
import WebProject from "../../pages/WebProject/WebProject";
import Card from "../Card/card";

const PortNav = props => (
  <div>
    <div className="navbar z-depth-3">
      <Link to="/portfolio" role="button">{props.button1} </Link>{" "}
      <Link to="/fashion" role="button"> {props.button2}</Link>{" "}
      <Link to="/paint" role="button"> {props.button3}</Link>{" "}
    </div>

      <div>
        <Card>
        {/* <WebProject/> */}

        <Route  path={`/fashion`} component={<WebProject/>} />


        </Card>

      </div>

  </div>
);

export default PortNav;
